function Login() {
    return(
        <div className="login">
                <form>
                    <h2>Sign-in</h2>
                    <label>Email *</label>
                    <input type="email"></input>
                    <label>Password *</label>
                    <input type="password"></input>
                    <p>Forgot Password?</p>
                    <button>LOG IN</button>
                    <p>Don't have an account?</p>
                    <p>Sign up</p>
                </form>
        </div>
    );
}
export default Login;
